import React, { Component } from 'react';
import $ from 'jquery';

class ArtistDetails extends React.Component {
  constructor(props){
    super(props);
    this.state = {
    };
  }


  render() {

    var clickedArtist = "John Prine"
    console.log(clickedArtist);
    $.ajax({
        url: "http://ws.audioscrobbler.com/2.0/",
        type: 'POST',
        contentType: "application/json; charset=utf-8",
        data: {
          method: 'artist.getInfo',
          artist: clickedArtist,
          api_key : '278b674c37ebf25ee302d1bc7edb0b76',
          format : 'json'
        },
        cache: false,
        success: function(data) {
            console.log(data['artist']['bio']['content']);
            $('#artistbio').html(data['artist']['bio']['content']);


        }
    });


    return (
    <div>

      <div className="artists" id="artistList">

        <p id="artistbio"></p>

      </div>


</div>
    )
  }

}

export default ArtistDetails;
